El poema presenta características típicas del estilo de Quevedo, como el juego de palabras, la estructura de soneto, y el uso de conceptos filosóficos y existenciales. Además, la complejidad lingüística y la estructura conceptual son muy características de este poeta del Siglo de Oro español.
